import React from "react";
import PDF from  "./image/pdf.png";
import "./research.css"


export default function Resume(){
    return(
        <div>
            <p className="text-pdf">Click Bellow to Download My CV</p>
            <a href="https://drive.google.com/file/d/129mDal8P_cEGxH5xxcqBfxBRQvDptgJE/view?usp=sharing" target="_blank"><img src={PDF} att="pdf" className="pdf"/></a>
        </div>
    )
}
